import { CommonModule } from '@angular/common';
import { ChangeDetectionStrategy, Component } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { MatSelectModule } from '@angular/material/select';
import { MatTableModule } from '@angular/material/table';
import { MatIconModule } from '@angular/material/icon';

export interface PeriodicElement {
  category: string;
  id: number;
  requirement: number;
  grade: string;
}
export interface Faculty {
  value: string;
  viewValue: string;
}

const ELEMENT_DATA: PeriodicElement[] = [
  {id: 1, category: 'Hydrogen', requirement: 1.0079, grade: 'H'},
  {id: 2, category: 'Helium', requirement: 4.0026, grade: 'He'},
  {id: 3, category: 'Lithium', requirement: 6.941, grade: 'Li'},
  {id: 4, category: 'Beryllium', requirement: 9.0122, grade: 'Be'},
  {id: 5, category: 'Boron', requirement: 10.811, grade: 'B'},
  {id: 6, category: 'Carbon', requirement: 12.0107, grade: 'C'},
  {id: 7, category: 'Nitrogen', requirement: 14.0067, grade: 'N'},
  {id: 8, category: 'Oxygen', requirement: 15.9994, grade: 'O'},
  {id: 9, category: 'Fluorine', requirement: 18.9984, grade: 'F'},
  {id: 10, category: 'Neon', requirement: 20.1797, grade: 'Ne'},
];

@Component({
  selector: 'app-program-manage',
  standalone: true,
  imports: [
    CommonModule,
    MatTableModule,
    MatFormFieldModule,
    MatSelectModule,
    MatInputModule,
    FormsModule,
    MatIconModule,
  ],
  templateUrl: './program-manage.component.html',
  styleUrls: ['./program-manage.component.css'],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class ProgramManageComponent {
  displayedColumns: string[] = ['category','requirement', 'grade'];
  programSource = ELEMENT_DATA;
  selectedFaculty: string | null = null;

  faculties: Faculty[] = [
    {value: 'fc', viewValue: 'Faculty of Computing'},
    {value: 'fkm', viewValue: 'Faculty of Mechanical Engineering'},
    {value: 'fke', viewValue: 'Faculty of Engineering'},
  ];

  clearFilter(): void {
    this.selectedFaculty = null;
  }
 }
